import * as React from 'react';
import { Pokedex } from './components/Pokedex.jsx'
import translate from 'translate-google-api';

export default function App() {


 async function teste() {
    let result = await translate(`I'm fine.`, {
      tld: "cn",
      to: "vi",
    });
  }



  return (
    <>
      <Pokedex />
    </>
  )
}
